import React, { useState } from "react";
import classes from "../styles/HeaderBurger.module.css";
import Navigation from "./Navigation";
import logoWhite from "../img/logoW.png";
import IconBurger from "../img/x.png";
import { useDispatch } from "react-redux";
import { activeBorgerAction } from "../store/Burger";
import { NavLink } from "react-router-dom";
import Yuovelir from "./Yuovelir";
import Clock from "./Clock";
import Brend from "./Brend";
import Aromat from "./Aromat";
import Izdelia from "./Izdelia";

const HeaderBurger = () => {
  const dispatch = useDispatch();
  const activeBurger = () => {
    dispatch(activeBorgerAction(true));
  };

  const [activPage, setActivPage] = useState(false);
  const [activClock, setActivClock] = useState(false);
  const [activBrend, setActivBrend] = useState(false);
  const [activAromat, setActivAromat] = useState(false);
  const [activIzdelia, setAcctivIzdelia] = useState(false);

  const actFun = () => {
    if (activPage === false) {
      setActivPage(true);
      setActivClock(false);
      setActivBrend(false);
      setActivAromat(false);
      setAcctivIzdelia(false);
    }
  };
  const actClock = () => {
    if (activClock === false) {
      setActivClock(true);
      setActivPage(false);
      setActivBrend(false);
      setActivAromat(false);
      setAcctivIzdelia(false);
    }
  };
  const actBrend = () => {
    if (activBrend === false) {
      setActivClock(false);
      setActivPage(false);
      setActivBrend(true);
      setActivAromat(false);
      setAcctivIzdelia(false);
    }
  };
  const actAromat = () => {
    if (activAromat === false) {
      setActivClock(false);
      setActivPage(false);
      setActivBrend(false);
      setActivAromat(true);
      setAcctivIzdelia(false);
    }
  };
  const actizdelia = () => {
    if (activIzdelia === false) {
      setActivClock(false);
      setActivPage(false);
      setActivBrend(false);
      setActivAromat(false);
      setAcctivIzdelia(true);
    }
  };

  return (
    <div>
      <div className={classes.main}>
        <div className={classes.content}>
          <div className={classes.wth}>
            <Navigation
              icon={logoWhite}
              iconBurger={IconBurger}
              func={activeBurger}
            ></Navigation>
          </div>
          <div className={classes.pages}>
            <div>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                onClick={() => {
                  actFun();
                }}
              >
                Ювелирные изделия
              </NavLink>
            </div>
            <div className={classes.act}>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                onClick={() => {
                  actClock();
                }}
              >
                часы
              </NavLink>
            </div>
            <div>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                onClick={() => {
                  actBrend();
                }}
              >
                бренды
              </NavLink>
            </div>
            <div>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                onClick={() => {
                  actAromat();
                }}
              >
                ароматы
              </NavLink>
            </div>
            <div className={classes.act}>
              <NavLink
                className={({ isActive }) => (isActive ? classes.active : "")}
                onClick={() => {
                  actizdelia();
                }}
              >
                изделия из кожи
              </NavLink>
            </div>
          </div>
          <div style={{ marginLeft: "162px", marginRight: "162px" }}>
            {activPage === true ? <Yuovelir></Yuovelir> : ""}
            {activClock === true ? <Clock></Clock> : ""}
            {activBrend === true ? <Brend></Brend> : ""}
            {activAromat === true ? <Aromat></Aromat> : ""}
            {activIzdelia === true ? <Izdelia></Izdelia> : ""}
          </div>
          <div className={classes.headerBottom}>
            <div className={classes.colection}></div>
            <div className={classes.telephone}></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HeaderBurger;
